<!DOCTYPE html>
        <html>
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>ASCII Animation</title>
            <style>
            
            @font-face {
                font-family: "Myfontascii";
                src: url('Myfontascii-Regular.ttf') format('truetype'); /* Şimdilik sadece ttf varsayıyoruz */
            }
            
            body {
                margin: 0; /* Body margin'ini sıfırla */
                display: flex; /* Ana container'ı ortalamak için */
                justify-content: center;
                align-items: center;
                min-height: 100vh; /* Tam ekran yüksekliği */
                background-color: #201408; /* Arkaplanı body'ye taşı */
                overflow: hidden; /* Sayfa taşmasını da engelleyelim */
            }
            .ascii-container {
                font-family: 'Myfontascii', monospace; /* Ayarlanan font */
                display: flex; /* İçeriği (grid) sarması için flex yeterli */
                overflow: visible; /* Taşmaları engelle */
                width: 100vw; /* Veya sığdırmak istediğin başka bir boyut */
                height: 100vh;
                max-width: calc(95vh * (40/40)); /* En boy oranını koru (genişlik yüksekliğe göre) */
                max-height: calc(95vw * (40/40)); /* En boy oranını koru (yükseklik genişliğe göre) */
            }
            .ascii-grid {
                display: grid;
                grid-template-columns: repeat(40, 1fr); /* Eşit sütunlar */
                grid-template-rows: repeat(40, 1fr);    /* Eşit satırlar */
                gap: 0;
                width: 100%; /* Container'ı doldur */
                height: 100%; /* Container'ı doldur */
            }
            .ascii-char {
                display: flex;
                align-items: center;
                justify-content: center;
                /* width: 2.5vw;  Grid hücresi boyutunu alır */
                /* height: 2.5vh; Grid hücresi boyutunu alır */
                overflow: visible; /* Karakter taşabilir */
                white-space: nowrap;
                line-height: 1;
                width: 100%;  /* ÖNEMLİ: Hücre genişliğini tam doldur */
                height: 100%; /* ÖNEMLİ: Hücre yüksekliğini tam doldur */
                min-width: 0; /* ÖNEMLİ: İçeriğin minimum genişliği etkilemesini engelle */
                min-height: 0; /* ÖNEMLİ: İçeriğin minimum yüksekliği etkilemesini engelle */
                /* font-size: 1vmin; /* Veya hücre boyutuna göre dinamik ayarlanabilir */
            }
        </style>
        </head>

            // --- IFRAME KONTROL FONKSİYONLARI ---
            function startAnimation() {
                if (!animationRunning) {
                    console.log('iframe: Animation started');
                    animationRunning = true;
                    animate(); // Animasyonu kaldığı yerden devam ettir
                }
            }

            function stopAnimation() {
                if (animationRunning) {
                    console.log('iframe: Animation stopped');
                    animationRunning = false;
                    if (timeoutId) {
                        clearTimeout(timeoutId);
                        timeoutId = null;
                    }
                }

                parent.postMessage({ type: "resize", height: height }, "*");

        const numFrames = framesData.length;
        const numChars = charElements.length;

        // --- KONTROL İÇİN EKLE ---
        if (numFrames > 0 && numChars > 0 && framesData[0] && framesData[0][0]) {
            console.log("İlk karenin ilk karakter verisi:", framesData[0][0]);
            // Beklenen çıktı: ['Karakter', 'rgb(x,y,z)', 'Boyut', 'text-shadow: ...'] veya ['Karakter', ..., '']
        }

        console.log(`Frames: ${numFrames}, Chars per frame: ${numChars}`); // Bilgi

        function animate() {
            if (!animationElement || numFrames === 0 || numChars === 0) {
                 console.error("Animasyon elemanı, kare verisi veya karakter elemanları bulunamadı!");
                 stopAnimation(); // Kontrol varsa durdur
                 return;
            }

            // Mevcut karenin verisini al
            const currentFrameData = framesData[currentFrame];

            // Her bir karakter span'ını güncelle
            for (let i = 0; i < numChars; i++) {
                const charElement = charElements[i];
                const data = currentFrameData[i]; // [char, color_rgb, font_size_em, glow_str]

                if (charElement && data) {
                    // 1. Karakteri güncelle (textContent daha verimli)
                    if (charElement.textContent !== data[0]) {
                         charElement.textContent = data[0];
                    }
                    // 2. Stilleri güncelle (sadece değiştiyse daha da optimize edilebilir ama şimdilik direkt atama)
                    charElement.style.color = data[1];
                    charElement.style.fontSize = data[2];
                    charElement.style.textShadow = data[3];
                } else if (!data) {
                    console.warn(`Frame ${currentFrame}, char index ${i} için veri bulunamadı.`);
                }
            }

            // Sonraki kareye geç
            currentFrame = (currentFrame + 1) % numFrames;

            // Animasyon devam etmeli mi kontrolü (timeoutId globalde)
            if (animationRunning) {
                timeoutId = setTimeout(animate, delay);
            }
        }

        // Animasyonu başlat
        if (numFrames > 0 && numChars > 0) {
           // Başlamadan önce yüksekliği gönderelim (DOM hazır)
           sendHeight();
           animate();
           console.log("iframe: Animation auto-started");
        } else {
           console.error("Animasyon başlatılamadı: Kare veya karakter elemanı yok.");
